import React from "react";
import { CSSProperties } from "react";
import ClockLoader from "react-spinners/ClockLoader";
const override = CSS`
  display: "block",
  margin: "0 auto",
  borderColor: "red",
`;

function Loading() {
  return (
    <div className="sweet-loading">
      <ClockLoader
        color="#000"
        cssOverride={override}
        loading
        size={80}
        speedMultiplier={0.1}
      />
    </div>
  );
}

export default Loading;
